		<h1><span class="masha_index masha_index1" rel="1"></span>ограждения заборные</h1>
		<div><span class="masha_index masha_index2" rel="2"></span>Дизайн и размах зависит исключительно от ваших пожеланий! Кованые ограждения могут иметь разнообразную форму: дуговые (полукруг), прямые или составные. Навершия так же имеют огромное разнообразие вариантов (пики, кованый орнамент, шары и т.д.). </div>
<h2><span class="masha_index masha_index3" rel="3"></span>Декоративные металлические заборы</h2>
<div><span class="masha_index masha_index4" rel="4"></span>Отличный вариант для разделения вашего дома на несколько секций. Возможно, вы захотите ковано-кирпичный забор или только навершения из металла, а не сплошной ковано-кирпичный. Наши кузнецы выполнят и эту задачу.</div>
<div><span class="masha_index masha_index5" rel="5"></span>Ниже предоставлены фотографии наших работ, которые уже радуют своих хозяев.По вопросам расценок обращайтесь по тел. +7(963)823-35-00.</div>
